type SectionProps = {
    title: string, 
    children: React.ReactNode
}

const Section = (props : SectionProps) => {
    return (
        <section className="section">
            <h2 className={`title${props.title}`}>{props.title}</h2>
            {props.children}
        </section>       
    )
}

export default Section;
